    data: |
      SELECT col1 * 68 FROM tab1 (FORMAT parquet) WHERE NOT col2 BETWEEN ( - - 64 ) AND NULL OR NOT col2 <= ( 32 + - 36 );
  - name: tab1

outputs:
  - name: q9541.out
    data: |
      3196
      340
      952
